import React from 'react';
import AppBar from '@material-ui/core/AppBar'
import { makeStyles, withStyles } from '@material-ui/core/styles';
import { Typography, TextareaAutosize } from '@material-ui/core';
import Logo from '../../ressources/img/logo-font.png';

const useStyles = makeStyles(theme => ({
    menuBar: {
        flexGrow: 1,
        position: "static",
        marginRight: theme.spacing(2),
    },
}))

class Menu extends React.Component {
    render() {
        return (
            <div>
                <AppBar className='menuBar'>
                    <img src={Logo} alt="pianoservice-logo" width="20%" height="auto"></img>
                    <Typography>
                    Pianoservice Kupski
                </Typography>
                </AppBar>

            </div>
        )
    }
}

export default Menu;M
